<html>
<head>
<style>
body {
  background-color: #002b36;
  font-family: Arial, sans-serif;
}
h1 {
  color: #586e75;
}
h2 {
  color: #657b83;
}
a {
  color: #268bd2;
}
ul {
  list-style: none;
  padding: 0;
  margin: 0;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(400px, 1fr));
  gap: 20px;
}
li {
  padding: 10px;
  border-bottom: none;
}
li:last-child {
  border-bottom: none; /* Remove the border on the last list item */
}

li:hover {
  background-color: #073642;
  cursor: pointer;
}

.container {
  max-width: 95%;
  margin: 0 auto;
}
.container img {
  max-width: 100%;
  max-height: 90vh;
  height: auto;
  display: block;
  margin: 10px auto;
}
.container vid {
  max-width: 100%;
  height: auto;
  display: block;
  margin: 10px auto;
}
.div_overlay {
  position: fixed;
  inset: 0.5em;
  width: 100%;
  height: 100%;
}
.overlay_container {
  height: 98%;
  max-width: 98%;
  position: fixed;
  margin-left: auto;
  margin-right: auto;
  inset: 0px;
}
.overlay_container img {
  width: 100%;
  height: auto;
}
</style>
<script>
function display(index) {
	console.log("slide_display " + index);
	var i;
	var slides = document.getElementsByClassName("overlay_container");
	for (i = 0; i < slides.length; i++) {
		slides[i].style.display = "none";  
	}
  var overlay = document.getElementById("div_overlay");
  overlay.style.display = "block";
	var overlay_image = document.getElementById("div_overlay_image_"+index);
	overlay_image.style.display = "block";
}
function undisplay(i) {
	var i;
	var slides = document.getElementsByClassName("overlay_container");
	for (i = 0; i < slides.length; i++) {
		slides[i].style.display = "none";  
	}
	var overlay = document.getElementById("div_overlay");
	overlay.style.display = "none";
}
</script>
</head>
